 #include <stdbool.h>
 #include <stdint.h>
 
 #include "Timer.h"
 #include "Speaker.h"
 #include "Sensor.h"
 #include "Debug.h"
 
 static bool triggered = false;
 static bool enabled = false;
 
 /** Alarm_Enable() **
 * Ready the Alarm for siren triggering
 * Outputs: none
 */
void Alarm_Init(){
	uint32_t period = (TIMER_1Hz / 6);
	uint32_t priority = 0x05;
	Timer0A_Init(period, priority);
	Timer0A_Start();
	Speaker_Init();
	Sensor_Init();
	triggered = false;
	enabled = false;
}

/** Alarm_Triggered() **
 * Check if the alarm is on / triggered
 */
bool Alarm_Triggered(void){
	return Sensor_Triggered() && enabled;
}

/** Alarm_Enable() **
 * Enable the Alarm completely
 * i.e. enable the sensor
 */
void Alarm_Enable(void){
	enabled = true;
	Sensor_Enable();
	Speaker_Mute();
}

/** Alarm_Disable() **
 * Disable the Alarm completely
 * i.e. turn off speaker and sensor
 */
void Alarm_Disable(void){
	enabled = false;
	triggered = false;
	Sensor_Disable();
	Speaker_Mute();
}

/** Alarm_Start() **
 * Trigger the alarm!
 */
void Alarm_Start(void){
	if(enabled){
		triggered = true;
		Timer0A_Arm();
	}
}

/** Alarm_Stop() **
 * Pause the alarm!
 */
void Alarm_Stop(void){
	triggered = false;
	Sensor_Reset();
	Timer0A_Disarm();
	Speaker_Mute();
	LED_RedOff();
}

void Timer0A_Handler(){
	Timer0A_Acknowledge();
	static bool play = true;
	if(enabled && triggered){
		if(play){
			play = false;
			Speaker_Play();
			LED_RedOn();
		} else{
			play = true;
			Speaker_Mute();
			LED_RedOff();
		}
	}
}


